import { MOSTRAR_ALERTA, OCULTAR_ALERTA } from "../types";

//Cada redicer toeme si state

const initialState = {
  alerta: null,
};

export default function (state = initialState, action) {
  switch (action.type) {
    default:
      return state;
  }
}
